VALUES ('8423263021575', 'Porc au caramel et riz naturhouse', 'Riz basmati précuit 33,9% (eau ; riz basmati ; huile de colza ; sel); viande de porc précuite 32,1 % (viande de porc ; eau ; sirop de glucose ; sel ; stabilisant : triphosphate pentasodique ; amidon modifié de maïs); eau ; caramel 2% (eau ; sucre); sauce soja 0,7% (eau ; soja ; farine de blé ; sel); extrait de chicorée ; gingembre ; arôme naturel ; arôme ; gomme de xanthane. Origine viande: France. Mode d\' emploi: Ouvrir partiellement le film et chauffer 2 minutes au micro-ondes à 750W. Ingredienti: Riso basmati precotto 33,9% (acqua, riso basmati, olio di colza, sale), carne di maiale 32,1 % (carne di maiale, acqua, sciroppo di glucosio, sale, stabilizzante: trifosfato pentasodico, amidi di mais modificato), acqua, caramello 2% (acqua, zucchero), salsa di soia 0,7% (acqua, soia, farina di grano, sale), estratto di cicoria, zenzero 0,7%, aroma naturale, aroma, gomma xantana. Modo d\'uso: Aprire parzialmente la pellicola e scaldare 2 minuti al microonde a 750W.', 'https://static.openfoodfacts.org/images/products/842/326/302/1575/front_fr.4.400.jpg', '5.2', '0.2', '39.7', '3.2', '1.1', '19.2', '1.8', '0.708661417322835', '', '0');

