VALUES ('8423263080084', 'KIBASIT Cap 60u, Kiluva', 'Sodium citrate, bulking agent: cellulose, capsule: gelatin and colouring E-171 and E-172, calcium citrate, potassium citrate, magnesium citrate, iron citrate, manganese citrate and anti-caking agent: magnesium stearate, INSTRUCTIONS FOR USE: Take 3 capsules per day, With water. Do not exceed stated recommended daily dose. Food supplements should not be used as a replacement of a balanced diet. Keep out of reach of children. STORAGE: Store in a cool, dry place, protected from light. CONTENT: 60 capsules of 660 mg. NET WEIGHT: 39,6 g. Lot Nr.:/ Best before end: pack). NATURHOUSE FRANCHISING COMPANY LTD. 23 Notting Hill Gate, YQ, London, UNITED KINGDOM. CF. SHARP TRAKINÇ INC. 290 General Luna st. Intramuros, Manila, PHILIPPINES. Made in the E.U. (F) KIBASIT, COMPLEMENT ALIMENTAIRE A BASE DE MINERAUX. INGREDIENTS PAR DOSE JOURNALIERE (3 capsules)\'. Citrate de sodium, agent de charge: cellulose, gélatine (capsule), citrate de calcium, citrate de potassium, sels de magnésium de l\'acide citrique, citrate ferreux, citrate de manganèse, antiagglomérant: sels de magnésium d\'acides gras, colorant E-171 (capsule) et colorant E-172 (capsule). MODE D\'EMPLOI: Prendre 3 capsules par jour, lors des repas principaux, avec un verre d\'eau. Ne pas dépasser la dose journalière recommandée. Les compléments alimentaires doivent être utilisés dans le cadre d\'un mode de vie sain et ne doivent pas être utilisés comme substituts d\'un régime alimentaire varié et équilibré. Maintenir hors de la portée des enfants, CONSERVATION: Conserver dans un endroit frais et sec, à température ambiante et à l\'abri de la lumière. CONTENU: 60 capsules de 660 mg. POIDS NET: 39.6 g. Lot consommer de préférence avant fin: (précisé sur emballage). NATURHOUSE SAS. 12 Rue Philippe Lebon 81000 Albi, FRANCE. (BE) PLIAS 1399/60. NATURHOUSE BELGIUM SPRL/BVBA Place Fernand coq 2.1050 Bruxelles. BELGIQUE. Produit dans I\'U.E. INFORMACIÔN NUTRICIONAL/INFORMAÇÂO NUTRICIONAL/INFORMATIQN NUTRITIONNELLE/INFORMAZIONI NUTRIZIONALI NUTRITIONAL INFORMATION/INFORMACJA ZYWNOSCIOWA/VOEDINGSINFORMATIE', 'https://static.openfoodfacts.org/images/products/842/326/308/0084/front_fr.6.400.jpg', '1', '0.6', '0', '0', '17', '15', '23', '9.05511811023622', '', '0');

