L. Produzido na U.E. FIBROKI TOST. INGREDIENTS: Wheat flour, vegetable fat [vegetable fats and oils from palm, sunflower and coconut, water, salt], fructose (14.7%), Wheat bran, sesame, Wheat starch, fresh eggs, soya flour, salt, raising agents (ammonium bicarbonate and sodium bicarbonate), sweetener (aspartame) and flavourings. Contains a source of phenylalanine. High fibre content. Made in a factory that also handles milk and nuts. Store in a cool, dry place out of direct sunlight. Best before: Batch (see base). Naturhouse Franchising Company LTD,? 23 Notting Hill Gate, YQ, London, UNITED KINGDOM. CFSHARP TRADING, INC. 290 casa Rocha Building, Gen. Luna St., Intramuros, Manila, PHILIPPINES. Produced in the E.U. PESO NETO/POIDS NET/NETTOGEWICHT/PESO LIQ', 'https://static.openfoodfacts.org/images/products/842/326/310/0669/front_fr.14.400.jpg', '20', '2.4', '61', '16', '8.8', '8.2', '0.09', '0.0354330708661417', '', '1');

